    /**
    * @param _owner: Owner of vault tokens
    * @return All vault tokens the user owns. Returns the vault address and token ID
    */
    function vaultTokensByOwner(address _owner) external view returns (UserTokens[] memory) {
        uint256 _tokensLength = 0;

        // Get number of tokens the user owns accross all vaults
        for(uint256 k = 0; k < vaultsLength(); k++) {
            _tokensLength += vaults[k].balanceOf(_owner);
        }

        UserTokens[] memory userTokens = new UserTokens[](_tokensLength);
        uint256 counter = 0;

        // Loop through all vaults
        for(uint256 i = 0; i < vaultsLength(); i++) {
            // Loop through all tokens user owns within a vault
            for(uint256 j = 0; j < vaults[i].balanceOf(_owner); j++) {
                userTokens[counter++] = UserTokens(
                    address(vaults[i]), 
                    vaults[i].tokenOfOwnerByIndex(_owner, j)
                );
            }
        }

        return userTokens;
    }

    // --------------------------------------------------------------------------------

    /**
    * @notice Create a trade with one of the approved vaults. The format for '_tokens',
    * '_amounts', and '_times' is specific to the vault. Refer to the vault being used
    * to verify the correct data format. Trades are only created with active vaults.
    * The strating amount of the trade is deposited upon creating a trade. A deposit fee
    * is taken from the deposited amount. When Gelato is active, a task is created for
    * each open order.
    * @param _vaultId: Index of vault in 'vaults'
    * @param _tokens: Specific to the vault used. Refer to vault documentation.
    * @param _amounts: Specific to the vault used. Refer to vault documentation.
    * @param _times: Specific to the vault used. Refer to vault documentation.
    * @param _maxGas: In gwei. The maximum gas price that any order within this trade
    * can be executed at.
    */
    function createTrade(
        uint256 _vaultId, 
        address[] memory _tokens, 
        uint256[] memory _amounts, 
        uint[] memory _times, 
        uint256 _maxGas
    ) external whenNotPaused nonReentrant {
        // Active vaults only
        require(
            vault(address(vaults[_vaultId])) == ACTIVE_VAULT, 
            "CornFi Controller: Inactive Vault"
        );

        // Create a trade and get the created orders 
        uint256[] memory orderIds = vaults[_vaultId].createTrade(msg.sender, _tokens, _amounts, _times);
        IVaultBase.Order[] memory orders = viewOrders(_vaultId, orderIds);

        emit CreateTrade(msg.sender, _vaultId, orders[0].tokenId);

        // Max gas price for when filling orders. Lower gas price saves the user ETH,
        // but increases the risk that their orders will not get filled during network
        // congestion.
        tokenMaxGas[_vaultId][orders[0].tokenId] = _maxGas;

        // When Gelato is active, create a task for the orders created. Gelato will monitor
        // each order and execute when trade conditions are met.
        if(Gelato) {
            for(uint i = 0; i < orders.length; i++) {

                emit CreateOrder(msg.sender, _vaultId, orders[i].orderId);

                // Gelato executors will call the Resolver contract with encoded
                // data to get the input data for filling an order. Specifically,
                // the Resolver will find the best path and router for the order
                // then encode the input data for 'fillOrderGelato'
                taskIds[_vaultId][orders[i].orderId] = PokeMe.createTaskNoPrepayment(
                    address(this), 
                    this.fillOrderGelato.selector, 
                    address(Resolver), 
                    abi.encodeWithSelector(
                        Resolver.checker.selector, 
                        _vaultId, 
                        orders[i].orderId, 
                        orders[i].tokens[0], 
                        orders[i].tokens[1], 
                        orders[i].amounts[0]
                    ),
                    GasToken
                );
            }
        }
    }

    // --------------------------------------------------------------------------------

    /**
    * @notice Fill open orders when trade conditions are met. Only Gelato executors
    * can call this function. This function is the primary method used to fill orders. 
    * If Gelato is no longer used, orders are filled through calling 'fillOrder()'
    * instead. Gelato executor will call 'checker()' in Resolver.sol first to get the 
    * router and path with the highest output amount. Gelato executor is refunded the 
    * gas cost from the ETH the order owner has deposited.
    * @param _vaultId: Index of vault in 'vaults'
    * @param _orderId: Order to fill
    * @param _router: Router used to fill the order
    * @param _path: Swap path used to fill the order
    */
    function fillOrderGelato(
        uint256 _vaultId, 
        uint256 _orderId, 
        IUniswapV2Router02 _router, 
        address[] memory _path
    ) external whenNotPaused onlyGelato nonReentrant {
        // Revert if the router is not whitelisted. 
        require(activeRouters[_router], "CornFi: Invalid Router");

        // Order to fill
        IVaultBase.Order memory _order = viewOrder(_vaultId, _orderId);

        // When tokenMaxGas = 0, the order can be fill at any gas price.
        // Otherwise, ensure that the gas price is below the user set max.
        if(tokenMaxGas[_vaultId][_order.tokenId] > 0) {
            require(
                tx.gasprice <= tokenMaxGas[_vaultId][_order.tokenId], 
                "CornFi Controller: Gas Price Too High"
            );
        }

        // Fill the order
        IVaultBase.Order memory order = vaults[_vaultId].fillOrder(msg.sender, _orderId, _router, _path);

        // If the order has an associated task ID, cancel the task
        if(taskIds[_vaultId][_orderId] != bytes32(0)) PokeMe.cancelTask(taskIds[_vaultId][_orderId]);

        // Owner of the order being filled
        address orderOwner = vaults[_vaultId].ownerOf(_order.tokenId);

        emit FillOrder(orderOwner, _vaultId, _order.tokenId, _orderId);

        // When using Gelato to fill orders.
        // An order ID greater than '0' indicates a new order was created. Create a new
        // task with Gelato to monitor and fill the created order.
        if(Gelato && order.orderId != 0) {

            emit CreateOrder(orderOwner, _vaultId, order.orderId);

            // Create a task with Gelato to monitor and fill the created order
            taskIds[_vaultId][order.orderId] = PokeMe.createTaskNoPrepayment(
                address(this), 
                this.fillOrderGelato.selector, 
                address(Resolver), 
                abi.encodeWithSelector(
                    Resolver.checker.selector, 
                    _vaultId, 
                    order.orderId, 
                    order.tokens[0], 
                    order.tokens[1], 
                    order.amounts[0]
                ),
                GasToken
            );
        }

        (uint256 fee, address feeToken) = PokeMe.getFeeDetails();

        // Check that the order owner has enough ETH deposited to cover the gas
        require(
            userGasAmounts[orderOwner] >= fee, 
            "CornFi Controller: Insufficent User Gas Funds"
        );

        // Subtract the gas spent from the order owners deposited amount of ETH
        userGasAmounts[orderOwner] = userGasAmounts[orderOwner].sub(fee);

        // Reimburse the caller for the gas spent filling the order
        _transfer(fee, feeToken);
    }

    // --------------------------------------------------------------------------------

    /**
    * @notice Fill open orders when trade conditions are met. Only approved order fillers
    * can call this function. This function will only be used if the use of Gelato is
    * stopped. Call 'findBestPath()' in Resolver.sol first to get the router and path
    * with the highest output amount. Caller is refunded the gas cost from the ETH the
    * order owner has deposited.
    * @param _vaultId: Index of vault in 'vaults'
    * @param _orderId: Order to fill
    * @param _router: Router used to fill the order
    * @param _path: Swap path used to fill the order
    */
    function fillOrder(
        uint256 _vaultId,
        uint256 _orderId, 
        IUniswapV2Router02 _router, 
        address[] memory _path
    ) external whenNotPaused onlyApprovedFillers nonReentrant {
        // Starting amount of gas
        uint256 startGas = gasleft();

        // Revert if the router is not whitelisted. 
        require(activeRouters[_router], "CornFi: Invalid Router");

        // Order to fill
        IVaultBase.Order memory _order = viewOrder(_vaultId, _orderId);

        // When tokenMaxGas = 0, the order can be fill at any gas price.
        // Otherwise, ensure that the gas price is below the user set max.
        if(tokenMaxGas[_vaultId][_order.tokenId] > 0) {
            require(
                tx.gasprice <= tokenMaxGas[_vaultId][_order.tokenId], 
                "CornFi Controller: Gas Price Too High"
            );
        }

        // Fill the order
        IVaultBase.Order memory order = vaults[_vaultId].fillOrder(msg.sender, _orderId, _router, _path);

        // If the order has an associated task ID, cancel the task
        if(taskIds[_vaultId][_orderId] != bytes32(0)) PokeMe.cancelTask(taskIds[_vaultId][_orderId]);

        // Owner of the order being filled
        address orderOwner = vaults[_vaultId].ownerOf(_order.tokenId);

        emit FillOrder(orderOwner, _vaultId, _order.tokenId, _orderId);

        // When using Gelato to fill orders.
        // An order ID greater than '0' indicates a new order was created. Create a new
        // task with Gelato to monitor and fill the created order.
        if(Gelato && order.orderId != 0) {

            emit CreateOrder(orderOwner, _vaultId, order.orderId);

            // Create a task with Gelato to monitor and fill the created order
            taskIds[_vaultId][order.orderId] = PokeMe.createTaskNoPrepayment(
                address(this), 
                this.fillOrderGelato.selector, 
                address(Resolver), 
                abi.encodeWithSelector(
                    Resolver.checker.selector, 
                    _vaultId, 
                    order.orderId, 
                    order.tokens[0], 
                    order.tokens[1], 
                    order.amounts[0]
                ),
                GasToken
            );
        }

        // Calculate the gas used for this tx.
        // Add 30,000 gas to account for the remaining instructions
        uint256 gasUsed = startGas.sub(gasleft()).add(30000);

        // Calculate the amount of ETH used for gas
        uint256 fee = gasUsed.mul(tx.gasprice);

        // Check that the order owner has enough ETH deposited to cover the gas
        require(
            userGasAmounts[orderOwner] >= fee, 
            "CornFi Controller: Insufficent User Gas Funds"
        );

        // Subtract the gas spent from the order owners deposited amount of ETH
        userGasAmounts[orderOwner] = userGasAmounts[orderOwner].sub(fee);

        // Reimburse the caller for the gas spent filling the order
        (bool success, ) = msg.sender.call{value: fee}("");

        // Check that the ETH transfer was successful
        require(success, "CornFi Controller: ETH transfer failed");
    }

    // --------------------------------------------------------------------------------

    /**
    * @notice Withdraws the ERC20 tokens owned by a vault token and returns to the token
    * owner. All open orders associated with the vault token are closed and the vault
    * token is burnt.
    * @param _vaultId: Index of vault in 'vaults'
    * @param _tokenId: Vault token  
    */
    function withdraw(uint256 _vaultId, uint256 _tokenId) external nonReentrant {
        // Get open orders for the vault token
        IVaultBase.Order[] memory _orders = viewOpenOrdersByToken(_vaultId, _tokenId);

        // Cancel the tasks with Gelato 
        for(uint i = 0; i < _orders.length; i++) {
            if(taskIds[_vaultId][_orders[i].orderId] != 0) {
                PokeMe.cancelTask(taskIds[_vaultId][_orders[i].orderId]);
            }
        }

        // Withdraw ERC20 tokens and burn vault token
        vaults[_vaultId].withdraw(msg.sender, _tokenId);

        emit Withdraw(msg.sender, _vaultId, _tokenId);
    }

    // --------------------------------------------------------------------------------

    /**
    * @notice Deposit ETH to pay for gas cost accrued from filling orders. ETH deposited
    * is automatically taken from the order owners balance when their orders are filled.
    * User is able to withdraw their balance of ETH at any point in time. This function
    * is not callable when 'isPaused()' == true.
    * @param _receiver: Address that is credited with the deposited ETH
    */
    function depositGas(address _receiver) external payable nonReentrant whenNotPaused {
        // User can only deposit ETH. Amount to deposit is msg.value.
        uint256 depositAmount = msg.value;

        // Add the deposited ETH to the '_receiver' balance
        userGasAmounts[_receiver] = userGasAmounts[_receiver].add(depositAmount);

        emit DepositGas(_receiver, GasToken, depositAmount);
    }

    // --------------------------------------------------------------------------------

    /**
    * @notice Remove the deposited ETH balance of a user. Any amount of ETH not used to
    * pay for gas is able to be withdrawn. Withdrawing ETH while still having open orders
    * will result in the orders not being filled. A user must maintain a certian amount
    * of ETH deposited to cover gas costs.  
    */
    function withdrawGas() external nonReentrant {
        // Revert if the user does not have any deposited ETH
        require(
            userGasAmounts[msg.sender] > 0, 
            "CornFi Controller: No User Funds to Withdraw"
        );

        // Get the balance of ETH the user has deposited
        uint256 amount = userGasAmounts[msg.sender];

        // Set user ETH balance to '0'
        delete userGasAmounts[msg.sender];

        // Transfer ETH balance to the user
        (bool success, ) = msg.sender.call{value: amount}("");

        // Revert if the transfer fails
        require(success, "CornFi Controller: ETH transfer failed");
    }


    // --------------------------------------------------------------------------------
    // ////////////////////////////// Internal Functions //////////////////////////////
    // --------------------------------------------------------------------------------    

    /**
    * @param _vault: Vault holding the trade
    * @param _tokenId: Vault token
    * @param _tradeId: Trade owned by the vault token
    * @return Orders within the trade 
    */
    function _viewTrade(
        IVaultBase _vault, 
        uint256 _tokenId, 
        uint256 _tradeId
    ) internal view returns (IVaultBase.Order[] memory) {
        // Get IDs of the orders within the trade 
        uint256[] memory tradeOrderIds = _vault.trade(_tokenId, _tradeId);

        IVaultBase.Order[] memory tradeOrders = new IVaultBase.Order[](tradeOrderIds.length);

        // Loop through the orders
        for(uint i = 0; i < tradeOrderIds.length; i++) {
            tradeOrders[i] = _vault.order(tradeOrderIds[i]);
        }
        return tradeOrders;
    }

    // --------------------------------------------------------------------------------

    /**
    * @dev Transfers the gas cost of filling an order to the Gelato executor. Payment
    * token must be ETH.
    * @param _amount: Amount of ETH to transfer
    * @param _paymentToken: ETH or ERC20 token used to pay for gas costs  
    */
    function _transfer(uint256 _amount, address _paymentToken) internal {
        require(_paymentToken == ETH, "CornFi Controller: Invalid Payment Token");
        (bool success, ) = gelato.call{value: _amount}("");
        require(success, "_transfer: ETH transfer failed");
    }

    // --------------------------------------------------------------------------------

    /**
    * @dev Whitelists an order filler and sets their state as active
    * @param _filler: Address that will fill orders 
    */
    function _addOrderFiller(address _filler) internal {
        // 0 = order filler not whitelisted
        require(
            activeOrderFillers[_filler] == 0, 
            "CornFi Controller: Invalid Order Filler"
        );

        // Add the order filler
        orderFillers.push(_filler);

        // Set order filler state to active
        activeOrderFillers[_filler] = 1;
    }

    // --------------------------------------------------------------------------------

    /**
    * @dev Whitelists a Uniswap V2 router for filling orders
    * @param _router: Router address
    */
    function _addRouter(IUniswapV2Router02 _router) internal {
        routers.push(_router);
        activeRouters[_router] = true;
    }

    // --------------------------------------------------------------------------------

    /**
    * @dev Sets the slippage amount used when filling orders
    * @param _slippagePoints: This value divided by '_slippageBasePoints' gives the 
    * slippage percentage.
    * @param _slippageBasePoints: Max amount of slippage points
    */
    function _setSlippage(uint256 _slippagePoints, uint256 _slippageBasePoints) internal {
        // Max slippage allowed is 2%
        require(
            _slippagePoints.mul(50) <= _slippageBasePoints, 
            "CornFi Controller: Max Slippage Exceeded"
        );
        SLIPPAGE_POINTS = _slippagePoints;
        SLIPPAGE_BASE_POINTS = _slippageBasePoints;
    }
